    BrowserRouter,
    Routes,
    Route,
    // Navigate,
    // Outlet
} from "react-router-dom";

import Login from '../componentsLoginMain';

export default function MyRoutes() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='home' element={<Home />} />
       
      </Routes>
    </BrowserRouter>
  )
}
